import React, { Component } from 'react';
import axios from 'axios';

export default class DeleteGig extends Component {
    constructor(props) {
        super(props);
        this.delete(this.props.match.params.id)
    }

    componentDidMount() {
        // Get the gig from the DB based on the given ID and set it to the current state of the page.
        axios.delete('http://localhost:4000/gigs/' + this.props.match.params.id)
            .catch(function (error) {
                console.log(error);
            })
    }

    delete = async (id) => {

        console.log('deleting')
        await axios.delete('http://localhost:4000/gigs/delete/' + id)
            .catch(function (error) {
                console.log(error);
            });

        // Change the display back to the main page (Gig List).
        this.props.history.push('/');
    }

    render() {
        return null
    }
}
